import React, { useState } from 'react';
import GuestHeader from '../components/GuestHeader';
import '../components/about.css';
import Footer from '../components/Footer';
import Header from '../components/Header';
import S_SearchBar from '../components/S_SearchBar';

// Home Landing Page
function Maow() {
  return (
    <div>
      <Header />
      <S_SearchBar />

      {/* Progress bar code (assuming you have it here) */}

      {/* Add the image below the progress bar */}
      <img src="../components/syd" alt="Maow Image" />
      {/* Replace "maow.jpg" with the correct image file name and extension */}

      <Footer />
    </div>
  );
}

export default Maow;
